import React from 'react';
import PropTypes from 'prop-types';
//Styles
import { Wrapper } from './Bottom.styles';

const Button = ({text, callback}) => (
    <Wrapper type='button' onClick={callback}>
        {text}
    </Wrapper>
)

export default Button;
